DIV.post_full .post_header,
DIV.post .post_header .post_info .post_info_link,
DIV.post .post_header .post_info_link,
DIV.post .post_tags .post_tag,
DIV.post-typography-update .post .post_content a  {
  color: pink;
}
DIV.post .post_tags .post_tag:hover,
DIV.post .post_header .post_info .post_info_link:hover,
DIV.post .post_header .post_info_link:hover,
DIV.post-typography-update .post .post_content a:hover {
  color: #FF6EBE;
}

.recommended_tumblelogs { max-height: none !important; }


body:not(.mceContentBody) {
	background: /*--url('http://static.tumblr.com/nyr6guj/JbTmvi9bh/1__1_.gif')--*/ url('data:image/gif;base64,') fixed /*++*/!important;
	color: #CF358E;
}
DIV.l-header-container {/*++*/
	background-color: transparent;
	box-shadow: none;
	position: absolute; /* let the header scroll off the top */
}

.follow_list_item_blog:before,
.radar_avatar:before,
#right_column:after {/*++*/
	display: none !important;
}

a {color: #F1237E;}

.notification blockquote {
border-left: solid 3px rgba(255,255,255,0.80);
color: rgba(255,255,255,0.60);}

.notification {color: rgba(255,255,255,.80);}

.notification .notification_sentence a.username {color: rgba(255,255,255,1.0);}

#xkit-control.tab.iconic > a {
background: url('http://static.tumblr.com/nyr6guj/ESQmvi9q3/download.png') 50% 50% no-repeat !important;}

/*--div.l-header .tab.iconic > a {
background-image: url('http://static.tumblr.com/nyr6guj/ftymvi9l9/navbar_sprite.png');}
.tab.iconic > .tab_anchor::before {
	content: none !important;
}

.tab_bar .tab_discover .tab_anchor {background-position: -175px 0}
.tab_bar .tab_log_out .tab_anchor {background-position: -140px 0}
.tab_bar .tab_settings .tab_anchor {background-position: -105px 0}
.tab_bar .tab_help .tab_anchor {background-position: -70px 0}
.tab_bar .tab_inbox .tab_anchor {background-position: -35px 0}
.tab_bar .tab_home .tab_anchor {background-position: 0 0}
.tab_bar .tab.iconic:hover .tab_anchor,.tab_bar .tab.iconic:active .tab_anchor {
  opacity: .7;
}--*/
.tab.iconic > .tab_anchor > I::before,
.tab.iconic > .tab_anchor::before {/*++*/
  color: rgb(255,110, 190) !important;
}
DIV.tab.iconic .tab_notice {
  border-color: white;
}
DIV.tab.iconic .tab_notice .tab_notice_value {
  color: white;
}
LI.popover_header {
  background-color: #FFB4E0;
  color: #CF358E;
}
.popover_menu_item_anchor {
  color: #F1237E !important;
}
LI.popover_menu_item:hover,
LI.popover_menu_item.keyboard_focus {
  background-color: rgb(255,223, 241);
}

.l-header > .compose-button {
	background-color: #FFB4E0;
	opacity: .5;
	border-color: #FF8EBE;
}
.l-header > .compose-button:hover {
	opacity: 1;
}
/*++*/

.post_full .post_permalink {
  /*--background: url('http://static.tumblr.com/nyr6guj/Gpumvi9je/flat_dogear.png') !important;--*/
  border-color: #FFB4E0 #FFB4E0 transparent transparent !important;
  background-color: rgba(255,180,224,.5) !important;
}

div.l-header .tab .tab_notice, .popover_blogs .tab_notice, .blog_menu .selected_blog .tab_notice {
background-color: #FF8EBE;}

.controls_section li.section_header {
border-radius: 0px;
color: rgba(255, 255, 255, 0.8);
width: 191px;
margin-left: 6px;
padding:0 6px;
border-bottom: 3px double rgba(255,255,255,0.7);
}

.pill.notice {color: #fff;}

#left_column, #right_column {background-color: transparent !important;}

/*--div.l-content.l-content.l-content {background: #FFB4E0;}--*/
.l-content {/*++*/
	background-color: #FFB4E0 !important;
	padding: 20px !important;
}

.blog_menu .selected_blog #open_blog_link {color: rgba(255,255,255,0.60);}

.xtag .result_title {margin-left: -22px;}


.controls_section a .count {color: rgba(255,255,255,.8);}
.controls_section li a {color: rgba(255,255,255,.8);}
.controls_section li {border-top:none;}
.controls_section .popover_button_blogs {border-bottom:none;}

.right_column>.controls_section:first-child {
margin: 7px 0 0 0;}

/*-.search_form_row-*/#search_query {background-color: #FF7CC4;}

.post_full .post_control:after {
background: url('http://s21.postimg.org/3slmughxz/dashboard_master_sprite.png') no-repeat;}


/*--.new_post_label .new_post_label_icon {
background-image: url('http://static.tumblr.com/nyr6guj/wsEmvi9ia/post_icons_sprite.png');}--*/
.new_post_label > I::before {/*++*/
  color: #FF7CC4;
}

.post .post_header a {color: #FF6EBE;}

.post_full .post_notes_label .note_link_current {color: #FF6EBE;}

.post_full .post_notes_label {color: #FF6EBE;}

.post .post_header a:hover {color: #FF6EBE;}

.post {
	background: #fff;
	/*border-radius: 8px;border:1px solid #FF6EBE*/;
}

#posts .post_content blockquote {border-left: solid 3px #FFB4E0;}

.post_avatar:after /*post nipple*/{
margin: -9px 0 0 12px;
border-right: 9px solid #fff;}

.post_content{background: transparent !important;}

div.l-header .selection_nipple {border-bottom: 12px solid #FFB4E0;}

#right_column:after {background: none !important;}

.controls_section li {
-webkit-border-radius: 8px;
-moz-border-radius: 8px;
border-radius: 8px;
background: #ff8ebe;
margin-top:8px;}
.controls_section li:hover {/*++*/
	background-color: rgba(255, 142, 190, .5) !important;
}
#logo {
	width: 187px;
	height: 40px;
	margin-top: 6px;
}
#logo > .logo_anchor {
	background-image: /*url('http://static.tumblr.com/nyr6guj/zm3mvi995/e70103034d8f386beeb5f79db7b80a0f.png')*/url('data:image/png;base64,');
	background-size: auto; /*++*/
}

}
